import{_ as e,o as r,c as a,O as i}from"./chunks/framework.9482e208.js";const c=JSON.parse('{"title":"§ 17.1-275.5 Amounts to be added; judgment in favor of the Commonwealth.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/17.1-275.5.md","filePath":"vacode/17.1-275.5.md"}'),t={name:"vacode/17.1-275.5.md"},l=i('<h1 id="§-17-1-275-5-amounts-to-be-added-judgment-in-favor-of-the-commonwealth" tabindex="-1">§ 17.1-275.5 Amounts to be added; judgment in favor of the Commonwealth. <a class="header-anchor" href="#§-17-1-275-5-amounts-to-be-added-judgment-in-favor-of-the-commonwealth" aria-label="Permalink to &quot;§ 17.1-275.5 Amounts to be added; judgment in favor of the Commonwealth.&quot;">​</a></h1><p>A. The clerk shall assess, in addition to the fees provided for by § <a href="http://law.lis.virginia.gov/vacode/17.1-275.1/" target="_blank" rel="noreferrer">17.1-275.1</a>, <a href="http://law.lis.virginia.gov/vacode/17.1-275.2/" target="_blank" rel="noreferrer">17.1-275.2</a>, <a href="http://law.lis.virginia.gov/vacode/17.1-275.3/" target="_blank" rel="noreferrer">17.1-275.3</a>, <a href="http://law.lis.virginia.gov/vacode/17.1-275.4/" target="_blank" rel="noreferrer">17.1-275.4</a>, <a href="http://law.lis.virginia.gov/vacode/17.1-275.7/" target="_blank" rel="noreferrer">17.1-275.7</a>, <a href="http://law.lis.virginia.gov/vacode/17.1-275.8/" target="_blank" rel="noreferrer">17.1-275.8</a>, <a href="http://law.lis.virginia.gov/vacode/17.1-275.9/" target="_blank" rel="noreferrer">17.1-275.9</a>, <a href="http://law.lis.virginia.gov/vacode/17.1-275.10/" target="_blank" rel="noreferrer">17.1-275.10</a>, <a href="http://law.lis.virginia.gov/vacode/17.1-275.11/" target="_blank" rel="noreferrer">17.1-275.11</a>, <a href="http://law.lis.virginia.gov/vacode/17.1-275.11:1/" target="_blank" rel="noreferrer">17.1-275.11:1</a>, or <a href="http://law.lis.virginia.gov/vacode/17.1-275.12/" target="_blank" rel="noreferrer">17.1-275.12</a>, the following costs:</p><ol><li><p>Any amount paid by the Commonwealth for legal representation of the defendant;</p></li><li><p>Any amount paid for trial transcripts;</p></li><li><p>Extradition costs;</p></li><li><p>Costs of psychiatric evaluation;</p></li><li><p>Costs taxed against the defendant as appellant under Rule 5A:30 of the Rules of the Supreme Court;</p></li><li><p>Any fee for a returned check or disallowed credit card charge assessed pursuant to subdivision A 28 of § <a href="http://law.lis.virginia.gov/vacode/17.1-275/" target="_blank" rel="noreferrer">17.1-275</a>;</p></li><li><p>Any jury costs;</p></li><li><p>Any assessment made pursuant to subdivision A 10 of § <a href="http://law.lis.virginia.gov/vacode/17.1-275/" target="_blank" rel="noreferrer">17.1-275</a>;</p></li><li><p>Any fees prescribed in §§ <a href="http://law.lis.virginia.gov/vacode/18.2-268.8/" target="_blank" rel="noreferrer">18.2-268.8</a> and <a href="http://law.lis.virginia.gov/vacode/46.2-341.26:8/" target="_blank" rel="noreferrer">46.2-341.26:8</a>;</p></li><li><p>Any court costs related to an ignition interlock device;</p></li><li><p>Any fee for testing for HIV;</p></li><li><p>Any fee for processing an individual admitted to jail as prescribed in § <a href="http://law.lis.virginia.gov/vacode/15.2-1613.1/" target="_blank" rel="noreferrer">15.2-1613.1</a>;</p></li><li><p>Any fee for courthouse security personnel as prescribed in § <a href="http://law.lis.virginia.gov/vacode/53.1-120/" target="_blank" rel="noreferrer">53.1-120</a>;</p></li><li><p>Any fee for a DNA sample as prescribed in § <a href="http://law.lis.virginia.gov/vacode/19.2-310.2/" target="_blank" rel="noreferrer">19.2-310.2</a>;</p></li><li><p>Reimbursement to the Commonwealth of medical fees as prescribed in § <a href="http://law.lis.virginia.gov/vacode/19.2-165.1/" target="_blank" rel="noreferrer">19.2-165.1</a>;</p></li><li><p>Any fee for a local criminal justice training academy as prescribed in § <a href="http://law.lis.virginia.gov/vacode/9.1-106/" target="_blank" rel="noreferrer">9.1-106</a>;</p></li><li><p>Any fee prescribed by §§ <a href="http://law.lis.virginia.gov/vacode/16.1-69.48:1/" target="_blank" rel="noreferrer">16.1-69.48:1</a>.01 and <a href="http://law.lis.virginia.gov/vacode/17.1-275.11/" target="_blank" rel="noreferrer">17.1-275.11</a>;</p></li><li><p>Any expenses charged pursuant to subsection B or F of § <a href="http://law.lis.virginia.gov/vacode/19.2-187.1/" target="_blank" rel="noreferrer">19.2-187.1</a>; and</p></li><li><p>Any fee for an electronic summons system as prescribed in § <a href="http://law.lis.virginia.gov/vacode/17.1-279.1/" target="_blank" rel="noreferrer">17.1-279.1</a>.</p></li></ol><p>B. The total amount of assessments described in subsection A, including (i) the fees provided for by § <a href="http://law.lis.virginia.gov/vacode/17.1-275.1/" target="_blank" rel="noreferrer">17.1-275.1</a>, <a href="http://law.lis.virginia.gov/vacode/17.1-275.2/" target="_blank" rel="noreferrer">17.1-275.2</a>, <a href="http://law.lis.virginia.gov/vacode/17.1-275.3/" target="_blank" rel="noreferrer">17.1-275.3</a>, <a href="http://law.lis.virginia.gov/vacode/17.1-275.4/" target="_blank" rel="noreferrer">17.1-275.4</a>, <a href="http://law.lis.virginia.gov/vacode/17.1-275.7/" target="_blank" rel="noreferrer">17.1-275.7</a>, <a href="http://law.lis.virginia.gov/vacode/17.1-275.8/" target="_blank" rel="noreferrer">17.1-275.8</a>, <a href="http://law.lis.virginia.gov/vacode/17.1-275.9/" target="_blank" rel="noreferrer">17.1-275.9</a>, <a href="http://law.lis.virginia.gov/vacode/17.1-275.10/" target="_blank" rel="noreferrer">17.1-275.10</a>, <a href="http://law.lis.virginia.gov/vacode/17.1-275.11/" target="_blank" rel="noreferrer">17.1-275.11</a>, <a href="http://law.lis.virginia.gov/vacode/17.1-275.11:1/" target="_blank" rel="noreferrer">17.1-275.11:1</a>, or <a href="http://law.lis.virginia.gov/vacode/17.1-275.12/" target="_blank" rel="noreferrer">17.1-275.12</a> and (ii) all other fines and costs, shall be docketed by the clerk as a judgment against the defendant in favor of the Commonwealth in accordance with § <a href="http://law.lis.virginia.gov/vacode/8.01-446/" target="_blank" rel="noreferrer">8.01-446</a>.</p><p>1999, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0009" target="_blank" rel="noreferrer">9</a>; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0831" target="_blank" rel="noreferrer">831</a>; 2003, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP1001" target="_blank" rel="noreferrer">1001</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP1022" target="_blank" rel="noreferrer">1022</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP1039" target="_blank" rel="noreferrer">1039</a>; 2010, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0555" target="_blank" rel="noreferrer">555</a>; 2012, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0714" target="_blank" rel="noreferrer">714</a>; 2013, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0263" target="_blank" rel="noreferrer">263</a>; 2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0325" target="_blank" rel="noreferrer">325</a>; 2015, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0641" target="_blank" rel="noreferrer">641</a>.</p>',5),n=[l];function o(g,s,f,v,h,p){return r(),a("div",null,n)}const b=e(t,[["render",o]]);export{c as __pageData,b as default};
